import React from "react";
import Topbar from "../../component/Topbar";
import Sidebar from "../../component/Sidebar";


function Home() {
  return (
    <div class="container">
      <div class="row">
        <div class="col-sm-2">
          <Sidebar />
        </div>
        <div class="col-sm-10">
          <Topbar />
        </div>
      </div>
    </div>
  );
}

export default Home;
